sys_script_include.script:
// @ts-nocheck

/**
 * Repository class for interacting with the sys_user table.
 * Extends the FCRepository class.
 * @class
 * @extends FCRepository
 */
var UserRepository = Class.create();

UserRepository.prototype = Object.extendsObject(FCRepository, {

    /**
     * Initializes a new instance of UserRepository.
     * @param {boolean} overrideACL - Whether to override ACL checks.
     * @throws Will throw an error if initialization fails.
     */
    initialize: function (overrideACL) {
		this.moduleName = 'UserRepository';
        UserRepository.prototype.initialize.call(this, 'sys_user', overrideACL);
    },

    /**
     * The type name of the class.
     * @type {string}
     */
    type: 'UserRepository'
});
